class Solution(object):
    def maxSlidingWindow(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: List[int]
        """
        from heapq import heapify, heapreplace, heappush
        if k == 0:
            return []
        heap, ret = [-nums[i] for i in range(k)], []
        heapify(heap)
        print(heap)
        for i in range(len(nums)-k):
            print('i = %d, finding: %d' %(i, nums[i]))
            ret.append(-heap[0])
            j = heap.index(-nums[i])
            heap[j] = heap[k-1]
            heap.pop()
            print('j = ', j)
            # swim
            while k-1 > j > 0:
                l = (j-1) // 2
                if heap[l] <= heap[j]:
                    break
                heap[j], heap[l] = heap[l], heap[j]
                j = l
            # sink
            while 2*j+1 < k-1:
                l = 2*j+1
                if l+1 < k-1 and heap[l+1] < heap[l]:
                    l = l+1
                if heap[j] <= heap[l]:
                    break
                heap[j], heap[l] = heap[l], heap[j]
                j = l
            print(heap)
            heappush(heap, -nums[i+k])
            print(i, heap)
        ret.append(-heap[0])
        return ret

